import React from "react";
import Button from "./Button";
import Input from "./Input";
import Text from "./Text";

const ReactBoxes = () => {
  const obj = {
    text: "This is Button",
    type: {
      button: "button",
      type: "type",
    },
    onClick: () => alert("XX"),
  };
  return (
    <div>
      <Button {...obj}></Button>
      <Input></Input>
      <Text></Text>
    </div>
  );
};

export default ReactBoxes;
